import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div className="relative min-h-screen bg-black text-white">
      {/* Background Image */}
      <div className="absolute inset-0 bg-cover bg-center opacity-30" style={{ backgroundImage: "url('/bg.jpg')" }}></div>

      {/* Content */}
      <div className="relative z-10 flex flex-col items-center justify-center h-screen text-center">
        <h1 className="text-4xl font-bold">Welcome to StreamFlix</h1>
        <p className="mt-2 text-lg">Subscribe now and enjoy exclusive content!</p>
        <Link to="/subscribe" className="mt-4 inline-block bg-red-600 text-white px-6 py-3 rounded text-lg">Subscribe Now</Link>
      </div>
    </div>
  );
};

export default Home;
